import React from 'react';
import PropTypes from 'prop-types';

const ExperienceCard = ({ title, company, period, description }) => (
  <div className="border border-[#ABB2BF] p-6 hover:border-[#C778DD] transition-colors">
    <div className="flex justify-between items-start mb-4">
      <div>
        <h3 className="text-xl font-bold">{title}</h3>
        <p className="text-[#C778DD]">{company}</p>
      </div>
      <span className="text-[#ABB2BF]">{period}</span>
    </div>
    <p className="text-[#ABB2BF]">{description}</p>
  </div>
);

ExperienceCard.propTypes = {
  title: PropTypes.string.isRequired,
  company: PropTypes.string.isRequired,
  period: PropTypes.string.isRequired,
  description: PropTypes.string.isRequired,
};

const Experience = () => {
  const experiences = [
    {
      title: "Software Engineer",
      company: "Tech Company",
      period: "2022 - Present",
      description: "Led development of multiple web applications using React and Node.js. Implemented responsive designs and improved application performance."
    },
    {
      title: "Frontend Developer",
      company: "Digital Agency",
      period: "2021 - 2022",
      description: "Developed and maintained client websites. Collaborated with designers to implement pixel-perfect designs and ensure optimal user experience."
    },
    {
      title: "Web Development Intern",
      company: "Startup Inc.",
      period: "2020 - 2021",
      description: "Assisted in developing website features and fixing bugs. Learned modern web development practices and agile methodologies."
    }
  ];

  return (
    <section id="experience" className="py-20 px-4 md:px-8">
      <div className="max-w-6xl mx-auto">
        <h2 className="text-3xl font-bold mb-8">
          <span className="text-[#C778DD]">#</span>experience
        </h2>
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {experiences.map((exp, index) => (
            <ExperienceCard key={index} {...exp} />
          ))}
        </div>
      </div>
    </section>
  );
};

export default Experience;
